import React from 'react';
import Edu from './Edu/Edu';
import Skills from './Skills/Skills';
import { Box } from '@material-ui/core';


function LeftSide() {
    return (
        <div>
            <Box borderRadius="1%"
                // justifyContent="center"
                // display="flex"
                boxShadow={3}
                bgcolor="paper.color"
                // m={6}
                // p={2}
                style={{ width: '20rem'}}
                >
                <Edu/>
                <br/>
                <Skills/>
            </Box>
        </div>
    );
}

export default LeftSide;
